sources.styles/utils/_reset.scss:
* {
  box-sizing: border-box;
  scroll-behavior: smooth;
}

body,
h1,
h2,
h3,
h4,
h5,
p,
div,
ul,
li {
  margin: 0;
  padding: 0;
}

body {
  font-family: 'Inter', Arial, Helvetica, sans-serif;
  background-color: $lightestGray;
  scroll-behavior: smooth;
}

a {
  text-decoration: none;
}

sources.styles/utils/_mixins.scss:
@mixin hover($_property, $_toValue) {
  transition: #{$_property} 0.3s;
  &:hover {
    #{$_property}: $_toValue;
  }
}

@mixin onTablet {
  @media (min-width: 744px) {
    @content;
  }
}

@mixin onDesktop {
  @media (min-width: 1260px) {
    @content;
  }
}

@mixin pagePadding {
  padding: 25px 30px 20px;

  @include onTablet {
    padding: 30px 34px 30px;
  }

  @include onDesktop() {
    padding: 30px 123px 30px;
  }
}

@mixin pageGap {
  gap: 110px;

  @include onTablet {
    gap: 140px;
  }

  @include onDesktop() {
    gap: 170px;
  }
}

sources.styles/blocks/_header.scss:
.header {
  min-height: 48px;
  display: flex;
  justify-content: space-between;
  align-items: center;

  &__logo-icon {
    transition: transform 0.3s;

    &:hover {
      transform: scale(1.2);
      transition: transform 0.3s;
    }
  }

  &__actions {
    align-items: center;

    &-close {
      transition: transform 0.3s;

      &:hover {
        transform: scale(1.2);
        transition: transform 0.3s;
      }
    }

    &-specs {
      font-size: 14px;
      font-weight: 300;
      margin-right: 20px;
      color: $slateGray;
      text-transform: uppercase;
    }

    &-lang {
      &-en,
      &-separator {
        color: $darkestGray;
        font-size: 14px;
        font-weight: 400;
        line-height: 18px;
      }

      &-separator {
        margin: 0 3px;
      }

      &-ua {
        color: $mediumGray;
        font-size: 14px;
        font-weight: 300;
        line-height: 18px;
      }
    }

    &-buy {
      display: flex;
      border: none;
      width: 100px;
      height: 48px;
      background-color: $darkestGray;
      color: #fff;
      font-size: 12px;
      font-weight: 500;
      justify-content: center;
      align-items: center;
      text-transform: uppercase;

      &--menu {
        display: block;
        width: 100%;
      }

      &:hover {
        background-color: $richBlack;
      }
    }

    &-menu {
      display: block;
      width: 32px;
      height: 32px;
      background-image: url("../images/icons/burger-menu.svg");
      transition: transform 0.3s;

      &:hover {
        transform: scale(1.2);
        transition: transform 0.3s;
      }
    }

    &-close {
      display: block;
      width: 24px;
      height: 24px;
      background-image: url("../images/icons/close.svg");
    }
  }
}

sources.styles/blocks/_aside.scss:
.menu {
  @include pagePadding;
  display: flex;
  flex-direction: column;
  row-gap: 0;
  height: 100vh;
  background-color: $lightestGray;
  position: fixed;
  overflow: auto;
  top: 0;
  left: 0;
  right: 0;
  opacity: 0;
  pointer-events: none;
  text-transform: uppercase;
  transition: all 0.3s;
  &-header {
    height: 48px;
  }

  &__list {
    display: flex;
    flex-direction: column;
    gap: 25px;
  }

  &__content {
    margin-top: 55px;
    height: inherit;

    &-text {
      @extend %quote-mobile;
      font-weight: 400;
      text-transform: uppercase;
      cursor: pointer;

      &--bold {
        font-weight: 700;
      }
    }
  }

  &__buy-button{
    display: flex;
    height: 48px;
    width: 100%;
  }

  &:target {
    opacity: 1;
    pointer-events: all;
    transition: all 0.3s;
  }
}

.header__actions{
  &--menu {
    margin-top: 50px;

  }
}

@include onTablet {
  .menu__buy-button,
  .menu__list-lang{
    display: none;
  }
}

