sources.styles/blocks/_footer.scss:
.footer {
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-top: 110px;

  &-logo,
  &-arrow {
    display: none;
  }

  &__container {
    display: flex;
    gap: 40px;
    margin-bottom: 20px;

    &-icon {
      width: 24px;
      height: 24px;
      transition: transform 0.3s;

