    margin-top: 140px;

    &-logo,
    &-arrow {
      display: block;

    }

    &-arrow {
      display: flex;
      align-self: flex-end;
      width: 50px;
      height: 50px;
      position: absolute;
      background: url(../images/icons/arrow-top.svg);
      transition: transform 0.3s;

      &:hover {
